import React from 'react';

const Slider = () => {
	return (
		<div>
			<input type="text" placeholder={'请输入问题'}/><br/>
			<input type="number" placeholder={'请输入最大值'}/><br/>
			<input type="number" placeholder={'请输入滑动步长'}/>
		</div>
	);
};

export default Slider;
